import React from "react";

class Categories extends React.Component{
    render({items,item}) {
        return(
            <div>
                <div className="categories">
                    <ul>
                        <li className="active">Все</li>

                        {this.items.map((name,i) => <li onClick={()=>this.item(name)} key={`${name}_${i}`}>{name}</li>)}
                    </ul>
                </div>
            </div>
        )
    }
}

